import React from 'react';
import ReactDOM from 'react-dom';

class Skills extends React.Component {
    render() {
        return (
            <div className="skills">
                <button>Test</button>
            </div>
        );
    }
}

ReactDOM.render(<Skills />, document.getElementById('root'));
export default Skills;
